def back_to_index(string, marker):


    string = [str(integer) for integer in string]
    string = ''.join(string)

    cluster = [''.join(g) for _, g in groupby(string)]

    if marker != False:
        string = [str(integer) for integer in string]
        string = ''.join(string)
        marker_cluster = [''.join(g) for _, g in groupby(marker)]
    else:
        marker_cluster = []

    indexes = []
    for element in cluster:
        indexes.append(len(element))

    add_index = [0]

    for element in indexes:
        temp = add_index[-1] + element
        add_index.append(temp)

    return add_index, marker_cluster

def split_sequence(sequence, n_steps):
	X, y = list(), list()
	for i in range(len(sequence)):
		# find the end of this pattern
		end_ix = i + n_steps
		# check if we are beyond the sequence
		if end_ix > len(sequence)-1:
			break
		# gather input and output parts of the pattern
		seq_x, seq_y = sequence[i:end_ix], sequence[end_ix]
		X.append(seq_x)
		y.append(seq_y)
	return np.array(X), np.array(y)


