def stationarity(indexs, data_in):

    total_gene_list = []
    gene_list_len = []
    number_of_segments = 40000
    for strain in indexs:
        count = 1
        strain_acc = []
        for x in range(1, len(strain)):
            if count % 2 == 0:
                for y in range(int(abs(strain[x]) - abs(strain[x - 1]))):
                    strain_acc.append(1)
            else:
                for y in range(int(abs(strain[x]) - abs(strain[x - 1]))):
                    strain_acc.append(0)
            count += 1


        def chunks_even_segment(l, n):
            return [l[i * n:(i + 1) * n] for i in range((len(l) + n - 1) // n)]

        def chunks(l, n):
           """Yield n number of sequential chunks from l."""
           d, r = divmod(len(l), n)
           for i in range(n):
               si = (d + 1) * (i if i < r else r) + d * (0 if i < r else i - r)
               yield l[si:si + (d + 1 if i < r else d)]

        genome_length = len(strain_acc)
        split_list = chunks_even_segment(strain_acc[:(40000 - ((genome_length // 125) - 40000)) * 125], 125)
        if (40000 - ((genome_length // 125) - 40000)) * 125 != genome_length:
            remaining_chunks = ((genome_length // 125)) - 40000
            second_half_of_split_list = chunks(strain_acc[(40000 - ((genome_length // 125) - 40000)) * 125:],
                                               remaining_chunks)
            final_second_half_of_split_list = []
            for element in second_half_of_split_list:
                final_second_half_of_split_list.append(element)
            split_list = split_list + final_second_half_of_split_list

        gene_list = []
        for element in split_list:
            ticker = 0
            for unit in element:
                if unit == 1:
                    ticker += 1
            gene_list.append(float(ticker / len(element)))

        total_gene_list.append(gene_list)
        gene_list_len.append(len(gene_list))


    min_segements = min(gene_list_len)
