def ideograms(fn):
    last_chrom = None
    fin = open(fn)
    fin.readline()
    xranges, colors = [], []
    ymin = 0
    for line in fin:
        chrom, start, stop, stain, label = line.strip().split()
        start = int(float(start))
        stop = int(float(stop))
        width = stop - start
        if chrom == last_chrom or (last_chrom is None):
            xranges.append((start, width))
            colors.append(color_lookup[stain])
            last_chrom = chrom
            continue
        ymin += height + spacing
        yrange = (ymin, height)
        yield last_chrom, xranges, yrange, colors, label
        xranges, colors = [], []
        xranges.append((start, width))
        colors.append(color_lookup[stain])
        last_chrom = chrom
    # last one
    ymin += height + spacing
    yrange = (ymin, height)
    yield chrom, xranges, yrange, colors, label


