def chunks_even_segment(l, n):
    return [l[i * n:(i + 1) * n] for i in range((len(l) + n - 1) // n)]


def chunks(l, n):
    """Yield n number of sequential chunks from l."""
    d, r = divmod(len(l), n)
    for i in range(n):
        si = (d + 1) * (i if i < r else r) + d * (0 if i < r else i - r)
        yield l[si:si + (d + 1 if i < r else d)]


genome_length = len(Actual_acc)
split_list = chunks_even_segment(Actual_acc[:(40000 - ((genome_length // segment) - 40000)) * segment], segment)
if (40000 - ((genome_length // segment) - 40000)) * segment != genome_length:
    remaining_chunks = ((genome_length // segment)) - 40000
    second_half_of_split_list = chunks(Actual_acc[(40000 - ((genome_length // segment) - 40000)) * segment:], remaining_chunks)
    final_second_half_of_split_list = []
    for element in second_half_of_split_list:
        final_second_half_of_split_list.append(element)
    split_list = split_list + final_second_half_of_split_list

Actual_output = []
for element in split_list:
    ticker = 0
    for unit in element:
        if unit == 1:
            ticker += 1
    Actual_output.append(ticker / len(element))
